<script>
    import HorizontalBar from "@/components/HorizontalBar";
    export default {
        components: {
            HorizontalBar
        },
        name: "PictureSweetshot",

        data(){
            return{
              colorPatch: 'black',
                fillColor:'none',
                IdPath: null,
            }
        },
        methods:{
            ShowPaths(arr){

                console.log(arr);
                if(arr == undefined){return}
               let paths = document.querySelectorAll('path');
                for ( let i =0; i<paths.length; i++ ) {
                    paths[i].style.display = 'none';
                }

               for ( let i =0; i<paths.length; i++ ) {

                 for (let j = 0; j< arr.length; j++){
                     if (paths[i].id == arr[j]) {
                         console.log(arr[j]);
                         paths[i].style.display = '';
                     }
                 }
               }
            },
            One(event){

                let paths = document.querySelectorAll('path');
                for ( let i =0; i<paths.length; i++ ) {
                    paths[i].style.stroke = 'black';
                    paths[i].style.strokeWidth = "1";

                }
                console.log(event.currentTarget.id);

                let path =  document.getElementById(event.currentTarget.id.toString());
                path.style.stroke = 'red';
                path.style.strokeWidth = "10";

            },

        },

        mounted(){

        }
    }
</script>

